package com.tm.pojo;

public class TD {

	private String date;
	private int value;

	
	
	public TD() {
		super();
		// TODO Auto-generated constructor stub
	}

	public TD(String date, int value) {
		super();
		this.date = date;
		this.value = value;
	}

	public String getDate() {
		return date;
	}

	public void setDate(String date) {
		this.date = date;
	}

	public int getValue() {
		return value;
	}

	public void setValue(int value) {
		this.value = value;
	}
}
